Ext.data.JsonP['Dashboard_4.15.1_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Dashboard 4.15.1  - 14 November 2017</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n        <div class=\"header\"/>\n\n        <div id=\"src-52297847\" class=\"content\">\n                        <h1>Dashboard 4.15.1  - 14 November 2017</h1>\n    <p>Dashboard 4.15.1 is a patch release, which includes the following bug fixes.    </p>\n    <div class=\"section section-2 \" id=\"src-52297847_Dashboard4.15.1ReleaseNote-Fixedissues\">\n        <h2 class=\"heading \"><span>Fixed issues</span></h2>\n<ul class=\" \"><li class=\" \">    <p>Fixed an issue where an error may occur when accessing the <strong class=\" \">Performance</strong> tab for Titanium and APS SDK applications.    </p>\n</li><li class=\" \">    <p>Fixed an issue where members of an organization that are not assigned the administrator role may not be able to access API Central, Business Event Service, or Search Service.    </p>\n</li></ul>    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=52297847\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Dashboard 4.15.1 Release Note"});